import React,{useState} from 'react'
import './segunda.css'

function Segunda() {
    const [lastComentario,setLastComentario]=useState("teste")
    
    
    return(
        <div className="painel">
           <input type="text" className="box_text" defaultValue={lastComentario}/>
        </div>
        
    );
}
export default Segunda;
